def min_cost(cost, m, n):
    # Initialize dp array with cost matrix
    dp = [[float('inf')] * n for _ in range(m)]
    for i in range(m):
        for j in range(n):
            dp[i][j] = cost[i][j]

    # Fill up the dp array
    for i in range(1, m):
        for j in range(1, n):
            dp[i][j] = min(dp[i-1][j], dp[i][j-1], dp[i-1][j-1] + cost[i][j])

    # Return the minimum cost to reach cell (m, n)
    return dp[m][n]

