import heapq

def heap_queue_largest(numbers):
    heapq.heapify(numbers)
    largest = numbers[0]
    while len(numbers) > 1:
        smallest = heapq.heappop(numbers)
        if numbers[0] < smallest:
            numbers[0], smallest = smallest, numbers[0]
        largest = max(largest, numbers[0])
    return largest

def count_ways(n):
    dp = [[[0 for _ in range(n+1)] for _ in range(n+1)] for _ in range(n+1)]
    for i in range(1, n+1):
        for j in range(1, n+1):
            for k in range(1, n+1):
                dp[i][j][k] = dp[i-1][j][k] + dp[i][j-1][k] - dp[i-1][j-1][k]
    return dp[n][n][n]

def count_ways(n):
    ways = [0]*(n+1)
    ways[0] = 1
    for i in range(1, n+1):
        ways[i] = ways[i-1] + ways[i-2]
    return ways[n, n+1]

def count_ways(n):
    dp = [[0 for _ in range(n+1)] for _ in range(n+1)]
    dp[n][0] = 1
    for i in range(n-1, -1, -1):
        for j in range(i+1, n+1):
            dp[i][j] = dp[i+1][j]
            if j >= 2:
                dp[i][j] += dp[i][j-2]
            if j >= 3:
                dp[i][j] += dp[i][j-3]
    return dp[0][n]

def count_ways(n):
    dp = [0]*(n+1)
    dp[0] = 1
    for i in range(1, n+1):
        dp[i] = 2**(i+1) - 1
        for j in range(i-1, 0, -1):
            dp[j] = dp[j] * dp[i-j-1]
    return sum(dp)

def differ_At_One_Bit_Pos(num1, num2):
    # Convert the integers into binary strings
    bin_str_num1 = bin(num1)[2:]
    bin_str_num2 = bin(num2)[2:]

    # Compare the binary strings
    if bin_str_num1 == bin_str_num2:
        return False
    else:
        return True

def differ_At_One_Bit_Pos(num1, num2):
    # Check if the lengths of the binary strings are not equal
    if len(bin(num1))!= len(bin(num2)):
        return True
    # Check if the lengths of the binary strings are equal and the contents are not equal
    elif len(bin(num1)) == len(bin(num2)) and num1!= num2:
        return True
    # If none of the above conditions is met, the numbers differ at one bit position
    else:
        return False

import re

def find_char_long(string):
    pattern = r' \w{4,} '
    return re.findall(pattern, string)

def small_nnum(dataset, n):
    if len(dataset) == 0:
        return "Error: Dataset is empty"

    sorted_dataset = sorted(dataset)
    return sorted_dataset[:n]

def small_nnum(dataset, n):
    if n > len(dataset):
        return []
    sorted_dataset = sorted(dataset)
    return sorted_dataset[:n]
